commits.content:
@import '../_variables.scss';
@import '../utils/_mixins.scss';


.logement_page{
    color: $primary-color;
    font-size: 18px;

    h1{
        font-size: 36px;
        font-weight: 500px;
    }
    h2{
        font-size: 18px;
        line-height: 50px;

    }

    .tags{
        display: flex;
        @media screen and (width <=768px){
            display: flex;
            flex-direction: column;
            flex-wrap: wrap;
            gap: 10px;
            .tag{
                padding: 10px auto;
                width: 50%;
            }
        }
    }
    .tag{
        background:$primary-color;
        color: white;
        border-radius: 10px;
        font-size: 14px;
        padding: 10px 30px;
        margin-left: 20px;

    }

}
.logement_title_owner{
   display: grid;
  gap: 40px;
  grid-template-columns: 49% 49%;
  padding: 20px;
  @media screen and (width <=768px){
    flex-direction: column;
}
}
.logement_owner{
display: grid;
justify-items: right;

.owner{
   display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
    gap: 20px;
    justify-items: right;
    h3{
        width: 150px;
        text-align: right;
    }

   // justify-content: right;
    text-align: right;
    img{
        width: 64px;
        height: 64px;
        background: #C4C4C4;
        border-radius: 50px;
        object-fit: cover;
    }
    }
}

.star{
    font-size: 36px;
    &.on{
        color: $primary-color;
    }
    &.off{
        color: #E3E3E3;
}

    }
    .container_description-equipment{
        display: grid;
        gap: 40px;
        grid-template-columns: 48% 48%;
       // overflow: hidden;
      @include dropdown
    }
